// @mui material components
import Grid from "@mui/material/Grid";

// Material Dashboard 2 React components
import MDBox from "components/MDBox";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import ReportsBarChart from "examples/Charts/BarCharts/ReportsBarChart";
import ReportsLineChart from "examples/Charts/LineCharts/ReportsLineChart";
import ComplexStatisticsCard from "examples/Cards/StatisticsCards/ComplexStatisticsCard";

// Data
import reportsBarChartData from "layouts/dashboard/data/reportsBarChartData";
import reportsLineChartData from "layouts/dashboard/data/reportsLineChartData";

// Dashboard components
import Projects from "layouts/dashboard/components/Projects";
import OrdersOverview from "layouts/dashboard/components/OrdersOverview";
import Popup from "reactjs-popup";
import { useState } from "react";
import axios from "axios";

function Dashboard() {
  // States Management
  const { sales, tasks } = reportsLineChartData;
  const [CSVFileUpload, SetCSVFileUpload] = useState(null)
  // Function Calling
  const downLoadSampleCSV=()=>{
    const blob = new Blob([sampleCSV], {type:"text/csv"});
    const link = document.createElement("a");
    link.href = window.URL.createObjectURL(blob);
    link.download = "sample-csv.csv";
    link.click();
    window.URL.revokeObjectURL(link.href);
  }
  const fileInputCSV=(event)=>{
    SetCSVFileUpload(event.target.files[0])
  }
  const FileUploadCSV=()=>{
    const formdata = new FormData();
    formdata.append("csv_file", CSVFileUpload)
    axios.post(API.BASE_URL+"csvupload/", formdata)
    .then((res)=>{
          if (res.data.message==="File uploaded and data saved successfully"){
                toast.success(res.data.message, {autoClose:1000})
          }
          else{
                toast.warn(res.data.message, {autoClose:1000})
          }
    })
    .catch((err)=>{
          toast.warn("Please Check the file again !", {autoClose:1000})      
    })
  }
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox py={3}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6} lg={3}>
            <Popup
              trigger={
                <MDBox mb={1.5}>
                  <ComplexStatisticsCard color="dark" icon="upload" title="Upload CSV" />
                </MDBox>
              }
              modal
              nested
            >
              {(close) => (
                  <div className='modal'>
                  <div className='content-popup'>
                        <div className="preview-sample">
                              <h3 className="heading">Upload an CSV</h3>
                              <p className="info-csv">Please Upload an Valid CSV. If you don't have sample CSV. <br/>
                              Click on <button type="button" className="sample-csv" onClick={downLoadSampleCSV}><u>Get Sample CSV</u></button>
                              </p>
                        </div>
                        <div className="input-file">
                              <input type="file" className="upload-csv-file" onChange={fileInputCSV}/>
                              <button type="button" className="save-file" onClick={FileUploadCSV}>Upload</button>
                        </div>

                  </div>
                  <div className="close-div">
                        <button className="close-button" onClick=
                              {() => close()}>
                              Close
                        </button>
                  </div>
            </div>
                )
              }
            </Popup>
          </Grid>
          {/* <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                icon="leaderboard"
                title="Today's Users"
                count="2,300"
                percentage={{
                  color: "success",
                  amount: "+3%",
                  label: "than last month",
                }}
              />
            </MDBox>
          </Grid> */}
          {/* <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="success"
                icon="store"
                title="Revenue"
                count="34k"
                percentage={{
                  color: "success",
                  amount: "+1%",
                  label: "than yesterday",
                }}
              />
            </MDBox>
          </Grid> */}
          {/* <Grid item xs={12} md={6} lg={3}>
            <MDBox mb={1.5}>
              <ComplexStatisticsCard
                color="primary"
                icon="person_add"
                title="Followers"
                count="+91"
                percentage={{
                  color: "success",
                  amount: "",
                  label: "Just updated",
                }}
              />
            </MDBox>
          </Grid> */}
        </Grid>
        {/* <MDBox mt={4.5}>
          <Grid container spacing={3}>
            <Grid item xs={12} md={6} lg={4}>
              <MDBox mb={3}>
                <ReportsBarChart
                  color="info"
                  title="website views"
                  description="Last Campaign Performance"
                  date="campaign sent 2 days ago"
                  chart={reportsBarChartData}
                />
              </MDBox>
            </Grid>
            <Grid item xs={12} md={6} lg={4}>
              <MDBox mb={3}>
                <ReportsLineChart
                  color="success"
                  title="daily sales"
                  description={
                    <>
                      (<strong>+15%</strong>) increase in today sales.
                    </>
                  }
                  date="updated 4 min ago"
                  chart={sales}
                />
              </MDBox>
            </Grid>
            <Grid item xs={12} md={6} lg={4}>
              <MDBox mb={3}>
                <ReportsLineChart
                  color="dark"
                  title="completed tasks"
                  description="Last Campaign Performance"
                  date="just updated"
                  chart={tasks}
                />
              </MDBox>
            </Grid>
          </Grid>
        </MDBox>*/}
